INSERT INTO `movieinfo` (`movie_id`, `movie_name`, `movie_description`, `movie_trailer`, `director_info`, `movie_length`, `releaseDate`, `start_promote`, `end_promote`) VALUES
(100000001, 'Avatar 2: The Way of Water', 'Jake Sully lives with his newfound family formed on the extrasolar moon Pandora. Once a familiar threat returns to finish what was previously started, Jake must work with Neytiri and the army of the Na\'vi race to protect their home.', 'https://youtu.be/t0sCVZk0VVM', 'James Cameron', 192, '2023-05-25', '2023-05-22', '2023-06-30'),
(100000002, 'John Wick 4', 'John Wick uncovers a path to defeating The High Table. But before he can earn his freedom, Wick must face off against a new enemy with powerful alliances across the globe and forces that turn old friends into foes.', 'https://www.youtube.com/watch?v=yjRHZEUamCc', 'Chad Stahelski', 169, '2023-06-06', '2023-05-22', '2023-06-30'),
(100000003, 'The Batman', 'When a sadistic serial killer begins murdering key political figures in Gotham, Batman is forced to investigate the city\'s hidden corruption and question his family\'s involvement.', 'https://www.youtube.com/watch?v=mqqft2x_Aa4', 'Matt Reeves', 175, '2023-03-03', '2023-02-15', '2023-03-25'),
(100000004, 'The Super Mario Bros. Movie', 'The story of The Super Mario Bros. on their journey through the Mushroom Kingdom.', 'https://www.youtube.com/watch?v=rG4tpqT5zlw', 'Aaron Horvath, Michael Jelenic, Pierre Leduc', 92, '2023-04-05', '2023-03-26', '2023-04-20'),
(100000005, 'Creed III', 'Adonis has been thriving in both his career and family life, but when a childhood friend and former boxing prodigy resurfaces, the face-off is more than just a fight.', 'https://www.youtube.com/watch?v=AHmCH7iB_IM', 'Michael B. Jordan', 116, '2023-03-02', '2023-02-14', '2023-03-16'),
(100000006, 'Dungeons & Dragons: Honor Among Thieves', 'A charming thief and a band of unlikely adventurers embark on an epic quest to retrieve a lost relic, but things go dangerously awry when they run afoul of the wrong people.', 'https://www.youtube.com/watch?v=IiMinixSXII', 'John Francis Daley, Jonathan Goldstein', 134, '2023-03-03', '2023-02-26', '2023-03-20'),
(100000007, 'Barbie', 'To live in Barbie Land is to be a perfect being in a perfect place. Unless you have a full-on existential crisis. Or you\'re a Ken.', 'https://www.youtube.com/watch?v=8zIf0XvoL9Y', 'Greta Gerwig', 92, '2023-07-21', '2023-07-01', '2023-07-31'),
(100000008, 'Operation Fortune: Ruse de guerre', 'Special agent Orson Fortune and his team of operatives recruit one of Hollywood\'s biggest movie stars to help them on an undercover mission when the sale of a deadly new weapons technology threatens to disrupt the world order.', 'https://www.youtube.com/watch?v=W8Sqk1GcqxY', 'Guy Ritchie', 114, '2023-04-20', '2023-04-05', '2023-05-02'),
(100000009, 'Spider-Man: Across the Spider-Verse', 'Miles Morales catapults across the Multiverse, where he encounters a team of Spider-People charged with protecting its very existence. When the heroes clash on how to handle a new threat, Miles must redefine what it means to be a hero.', 'https://www.youtube.com/watch?v=cqGjhVJWtEg', 'Joaquim Dos, SantosKemp Powers, Justin K. Thompson', 120, '2023-06-02', '2023-05-22', '2023-06-30'),
(100000010, 'Guardians of the Galaxy Vol. 3', 'Still reeling from the loss of Gamora, Peter Quill rallies his team to defend the universe and one of their own - a mission that could mean the end of the Guardians if not successful.', 'https://www.youtube.com/watch?v=u3V5KDHRQvk', 'James Gunn', 150, '2023-05-26', '2023-05-22', '2023-06-30'),
(100000011, '65', 'An astronaut crash lands on a mysterious planet only to discover he\'s not alone.', 'https://www.youtube.com/watch?v=bHXejJq5vr0', 'Scott BecBryan Woods', 93, '2023-04-12', '2023-04-01', '2023-04-26'),
(100000012, 'Detective Conan The Movie 26 : Black Iron Submarine', 'This time\'s location is set in the sea near the Hachijo-jima island, Tokyo. Engineers from around the world have gathered for the full-scale operation of \"Pacific Buoy,\" an offshore facility to connect security cameras owned by the worldwide police forces. A test of a certain \"new technology\" based on a face recognition system is underway there.\r\n\r\nMeanwhile, Conan and the Detective Boys visit Hachijo-jima at Sonoko\'s invitation and receive a phone call from Subaru Okiya informing them that a Europol employee was murdered in Germany by the Black Organization\'s Jin.\r\n\r\nConan, who is disquieted, sneaks into the facility and finds that a female engineer has been kidnapped by the Black Organization...! Furthermore, a USB drive containing certain information in her possession ends up in the hands of the organization... A black shadow also creeps up on Ai Haibara ...', 'https://www.youtube.com/watch?v=gGynIKMklkI', 'Tachikawa Yuzaru', 110, '2023-04-26', '2023-04-14', '2023-05-12');
INSERT INTO `promotion` (`promotion_code`, `discount_percent`, `start_date`, `end_date`,  `description`) VALUES
('AIS15', 15, '2023-01-01 00:00:00', '2023-12-31 23:59:59', 'Special 15% discount for AIS customers with no restrictions, applicable to all system type and all types of seats'),
('BLOCKBUSTER', 15, '2023-01-01 00:00:00', '2023-12-31 23:59:59', 'Watch Blockbuster Movies at BED CINEMAget a 15% discount throughout the year.'),
('CHRISTMAS', 50, '2022-12-24 00:00:00', '2022-12-25 23:59:59', 'Christmas Party, discount 50% for two days'),
('DTAC20', 20, '2023-01-01 00:00:00', '2023-12-31 23:59:59', 'Special 20% discount for DTAC customers applicable to Honeymoon seat for all system type.'),
('STUDENT20', 20, '2023-01-01 00:00:00', '2023-12-31 23:59:59', 'Just show your student ID card and get a 20% discount for all movies and all types of seats, for every showtime.'),
('SUMMER10', 10, '2023-03-01 00:00:00', '2023-05-31 23:59:59', 'Special 10% discount For Summer 2003, usable for Premium Seat, Laser system type');
